import React from "react";

const Films = ({ films }) => {
  let x = [];
  return (
    <div>
      <h1>Films</h1>
      {films ? (
        <div>
          <ul>
            {x.push(films)}
            {x.map((film) => {
              console.log(film);
            })}
          </ul>
        </div>
      ) : (
        <></>
      )}
    </div>
  );
};

export default Films;
